import { link } from "fs";
import { Fragment } from "react";
export default function ListGroup() {
  const items = ["isto", "e", "fixe"];

  const message = items.length === 0 ? <p>nada!</p> : null;
  return (
    <>
      <h1>bruh</h1>
      {}
      <ul className="list-group">
        {items.map((item) => (
          <li key={item}>{item}</li>
        ))}
      </ul>
    </>
  );
}
